func testUserToManyRemoveOpFieldOfStudies(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a User
	var b, c, d, e FieldOfStudy

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, userDBTypes, false, strmangle.SetComplement(userPrimaryKeyColumns, userColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*FieldOfStudy{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, fieldOfStudyDBTypes, false, strmangle.SetComplement(fieldOfStudyPrimaryKeyColumns, fieldOfStudyColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddFieldOfStudies(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.FieldOfStudies().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveFieldOfStudies(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.FieldOfStudies().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if len(b.R.Users) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if len(c.R.Users) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if d.R.Users[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}
	if e.R.Users[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}

	if len(a.R.FieldOfStudies) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.FieldOfStudies[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.FieldOfStudies[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

